INSERT INTO `competition` VALUES (9,'Pikts Karpis - TOP5, Punia 2018','2018-09-13 00:00:00',3,'Pikts Karpis','info@piktsKarpis.lt','Punia','top5',1,'finished',7,4,'https://www.facebook.com/events/240567726665093/','1. Varžomasi komandoje, komandą sudaro 2-3 karpininkai, komandą gali lankyti svečiai, tačiau jie negali padėti varžybų dalyviams.\n2. Tyrinėti sektorių markeriu, jaukinti žuvį ir masalus mesti į vandenį galima tik nuo varžybų starto pradžios.\n3. Žvejoti galima 4 įrankiais turinčiais po 1 kablį. Paruoštų įrankių skaičius neribojamas.\n4. Markeris naudojamas tik dugno tyrinėjimui ir gylio nustatymui, baigus dugno tyrinėjimą markeris turi būti ištrauktas iš vandens. Markerį naudoti kaip žymeklį draudžiama.\n5. Jaukinti ir masalus mesti galima tik iš savo sektoriaus zonos (swim’o) visais būdais, išskyrus valtis ir specialius laivelius.\n6. Nuo 19:00 valandos iki 7:00 valandos jaukinti žuvis naudojant triukšmingus jaukinimo įrankius, tokius kaip spomb‘as, raketas, „krabus“ draudžiama.\n7. Masalas tvirtinamas prie kabliuko naudojant „plauko sistemą“. Draudžiama naudoti gyvus jaukus ir masalus (musės lervos, sliekai, uodo trūklio lervos ir pan.).\n8. Žuvies ištraukimas ne savo sektoriuje yra leidžiamas kaimyniniam sektoriui sutikus. Bristi į vandenį galima tik iki juosmens.\n9. Kol žuvis bus pasverta ir užregistruota, ją reikia laikyti specialiame maiše, vandenyje. Viename maiše gali būti ne daugiau kaip viena žuvis. Privaloma turėti ne mažiau kaip 7 specialius maišus žuviai laikyti.\n10. Kiekviena komanda privalo turėti specialų čiužinį žuviai guldyti ant žemės (matą).\n11. Kiekviena varžybų komanda turi turėti ne mažiau kaip du graibštus.\n12. Registruojamos tik gyvos žuvys, pagautos varžybų tvenkinyje varžybų metu.\n13. Įskaitinės žuvys yra visų rūšių karpiai ir amūrai.\n14. Sugautos įskaitinės žuvys sveriamos tik teisėjo svėrimo įrankiais ir svarstyklėmis. Žuvis sveriama kiek galima dažniau, bet ne rečiau kaip 3 kartus per parą.\n15. Jeigu žuvis užkibo iki varžybų pabaigos ir varžybų dalyvis mano, kad žuvis galimai bus ištraukta jau po varžybų finišo, ją leidžiama ištraukti, ir ji bus registruojama, tačiau nedelsiant po kibimo turi būti pranešta teisėjui arba kaimynams, kad žuvis traukiama.\n16. Kiekvieno sektoriaus šoninės ribos yra pažymėtos. Kai kurie sektoriai gali būti apriboti ir metimo nuotoliu. Apie sektorių apribojimus varžybų organizatoriai informuos iš anksto. Ginčus tarp dalyvių dėl žūklės sektorių ribų sprendžia patys varžybų dalyviai, neišsprendus ginčo – jis sprendžiamas neapskundžiamu (galutiniu) varžybų teisėjo sprendimu.\n17. Komandos abiems nariams pasitraukus iš sektoriaus toliau nei 50 metrų, žūklės įrankiai turi būti ištraukti iš vandens.\n18. Į ne savo sektorių patekti kitiems varžybų dalyviams galima tik gavus sektoriaus dalyvio sutikimą. Sutikimas nebūtinas varžybų organizatoriui, teisėjui, telkinio savininkui arba jo atstovui, žurnalistams.\n19. Varžybos dalyviai privalo: gerbti kitus varžybų dalyvius; esant nenumatytai situacijai (trauma, nelaimingas atsitikimas ir t.t..) padėti kitiems; sektoriuje palaikyti švarą; kilus šiose taisyklėse nenumatytiems klausimams ar situacijoms nedelsiant susisiekti su teisėju ir jį informuoti.\n20. Komandai nusižengus taisyklėms pirmą kartą, teisėjai gali stabdyti dalyvavimą varžybose 4 val., Komandai prasižengus antrą kartą, skiriama 8 val. diskvalifikacija. Trečią kartą nusižengęs taisyklėms komanda diskvalifikuojama. Už grubius taisyklių pažeidimus ar besaikį alkoholio vartojimą, dalyvis gali būti šalinamas iš varžybų nedelsiant teisėjų nuožiūra.'),(10,'Didelėsžuvys.lt-2014','2014-08-15 00:00:00',2,'Didelėsžuvys.lt','info@didelėszuvys.lt','Didelėsžuvys.lt','total',1,'finished',7,6,'https://www.facebook.com/dideleszuvys/photos/a.681680671920890/685735184848772/?type=3&theater','\n\n    Pagal atvykusių komandų eilės tvarką komandos traukia eilės numerius pagal kurios komandos trauks sektoriaus numerį. Po komandų sektorių traukimo, pretenzijos dėl sektorių nepriimamos.\n\n    Pasiruošimo metu komandos gali tyrinėti sektorių markeriu. Markeris naudojamas tik dugno tyrinėjimui ir gylio nustatymui, baigus dugno tyrinėjimą markeris turi būti ištrauktas iš vandens. Markerį naudoti kaip žymeklį draudžiama.\n\n    Jaukinti žuvį ir masalus mesti į vandenį galima tik nuo varžybų pradžios.\n\n    Komanda gali žvejoti 4 įrankiais turinčiais po 1 kablį. Paruoštų įrankių skaičius neribojamas.\n\n    Meškerės turi būti žūklės sektoriuje, paruoštoje zonoje. Jaukinti galima tik iš savo sektoriaus zonos visais būdais, išskyrus valtis ir specialius laivelius. Galima bristi į vandenį ne giliau kaip iki juosmens.\n\n    Nuo 22 valandos vakaro iki 5 valandos ryto jaukinti žuvis naudojant triukšmingus jaukinimo įrankius, tokius kaip spomb‘as, raketas, „krabus“ draudžiama.\n\n    Masalų užmetimui galioja šių taisyklių penkto punkto reikalavimai.\n\n    Ne komandos dalyviams dalyvauti žvejybos procese (imti žūklės įrankius, ruošti pašarus ir pan.) draudžiama.\n\n    Masalas tvirtinamas prie kabliuko naudojant „plauko sistemą“ (negalima verti tiesiai ant kabliuko).\n\n    Draudžiama naudoti gyvus ir cielus gyvulinės kilmės jaukus ir masalus (musės lervos, sliekai, uodo trūklio lervos ir pan.).\n\n    Žuvies ištraukimas ne savo sektoriuje yra leidžiamas kaimyninio sektoriaus komandai sutikus.\n\n    Kol žuvis bus pasverta ir užregistruota, ją reikia laikyti specialiame maiše, vandenyje. Viename maiše gali būti ne daugiau kaip viena žuvis. (savininkui sutikus galima žuvį laikyti graibšte kol ji bus pasverta). Komanda privalo turėti ne mažiau kaip 6 specialius maišus žuviai laikyti.\n\n    Žuvys sveriamos tris kartus per parą. Esant galimybei, žuvys gali būti sveriamos ir dažniau.\n\n    Kiekviena komanda privalo turėti specialų čiužinį žuviai guldyti ant žemės (matą).\n\n    Registruojamos tik gyvos žuvys, pagautos „Didelėsžuvys.lt“ tvenkinyje varžybų metu.\n\n    Įskaitinės žuvys yra nuo 5 kg visų rūšių karpiai, amūrai, eršketai, šamai.\n\n    Jei ištraukus žuvį kabliukas nėra įkibęs galvos srityje, žuvis neužskaitoma.\n\n    Sugautos įskaitinės žuvys sveriamos tik teisėjo svėrimo įrankiais ir svarstyklėmis.\n\n    Jeigu žuvis užkibo iki varžybų pabaigos ir komanda mano, kad žuvis galimai bus ištraukta jau po varžybų finišo, ją leidžiama ištraukti ir ji bus registruojama, tačiau nedelsiant po kibimo turi būti pranešta teisėjui arba kaimyninėm komandom, kad žuvis traukiama. Nesant tokio pranešimo teisėjui, žuvis bus registruojama tik tuo atveju, jei ji bus ištraukta ir apie tai paliudys kaimyninės komandos, kad žuvis užkibo iki varžybų pabaigos.\n\n    Kiekvieno sektoriaus šoninės ribos yra pažymėtos kuoliukais. Kai kurie sektoriai gali būti apriboti ir metimo nuotoliu. Apie sektorių apribojimus varžybų organizatoriai informuos iš anksto. Ginčus tarp komandų dėl žūklės sektorių ribų sprendžia patys varžybų dalyviai, neišsprendus ginčo – jis sprendžiamas neapskundžiamu (galutiniu) varžybų teisėjo sprendimu.\n\n    Komandos nariams pasitraukus iš sektoriaus toliau nei 50 metrų žūklės įrankiai turi būti ištraukti iš vandens (išskyrus markerį).\n\n    Į sektorių patekti kitiems varžybų dalyviams galima tik gavus komandos narių sutikimą. Sutikimas nebūtinas varžybų organizatoriui, teisėjui, telkinio savininkui arba jo atstovui, žurnalistams.\n\n    Varžybose dalyvaujanti komanda privalo: gerbti kitus varžybų dalyvius; esant nenumatytai situacijai (trauma, nelaimingas atsitikimas ir t.t..) padėti kitiems; sektoriuje palaikyti švarą; kilus šiose taisyklėse nenumatytiems klausimams ar situacijoms nedelsiant susisiekti su teisėju ir jį informuoti.\n\n    Nusižengusiai taisyklėms komandai pirmą kartą teisėjai gali skirti nuobaudą -5kg iš komandos sugautų žuvų svorio. Antrą kartą prasižengusiai kamandai skiriama nuobauda -10kg iš komandos sugautų žuvų svorio. Trečią kartą nusižengusi taisyklėms komanda diskvalifikuojama. Už grubius taisyklių pažeidimus ar besaikį alkoholio vartojimą, komanda gali būti šalinama iš varžybų nedelsiant teisėjų nuožiūra.\n\n \n\nKomandos varžybų starto mokestis 200 € sumokamas ne vėliau kaip likus 60 dienų iki varžybų pradžios.\n\nSumokėti galima banko pavedimu\n\nSąskaita - LT077290000139702013\n\nGavėjas - Kęstutis Arbačiauskas\n\nMokėjimo paskirtis - Varžybų starto mokestis \"komandos pavadinimas\"\n\nPirmąją vietą užėmusi komanda ateinančių metų varžybose registruojama be startinio mokesčio.'),(11,'Pikts Karpis, Pykaičiai 2018','2018-08-02 00:00:00',3,'Pikts Karpis','info@piktsKarpis.lt','Pykaičiai','total',1,'finished',15,4,'https://www.facebook.com/events/1181032402028380/?active_tab=about','1. Varžomasi individualiai, dalyvį gali lankyti svečiai, tačiau jie negali padėti varžybų dalyviui.\n2. Tyrinėti sektorių markeriu, jaukinti žuvį ir masalus mesti į vandenį galima tik nuo varžybų starto pradžios.\n3. Žvejoti galima 3-mis įrankiais turinčiais po 1 kablį. Paruoštų įrankių skaičius neribojamas.\n4. Markeris naudojamas tik dugno tyrinėjimui ir gylio nustatymui, baigus dugno tyrinėjimą markeris turi būti ištrauktas iš vandens. Markerį naudoti kaip žymeklį draudžiama.\n5. Jaukinti ir masalus mesti galima tik iš savo sektoriaus zonos (swim’o) visais būdais, išskyrus valtis ir specialius laivelius.\n6. Nuo 21 valandos vakaro iki 7 valandos ryto jaukinti žuvis naudojant triukšmingus jaukinimo įrankius, tokius kaip spomb‘as, raketas, „krabus“ draudžiama.\n7. Masalas tvirtinamas prie kabliuko naudojant „plauko sistemą“. Draudžiama naudoti gyvus jaukus ir masalus (musės lervos, sliekai, uodo trūklio lervos ir pan.).\n8. Žuvies ištraukimas ne savo sektoriuje yra leidžiamas kaimyniniam sektoriui sutikus. Bristi į vandenį galima tik iki juosmens.\n9. Kol žuvis bus pasverta ir užregistruota, ją reikia laikyti specialiame maiše, vandenyje. Viename maiše gali būti ne daugiau kaip viena žuvis. Privaloma turėti ne mažiau kaip 5 specialius maišus žuviai laikyti.\n10. Kiekviena komanda privalo turėti specialų čiužinį žuviai guldyti ant žemės (matą).\n11. Kiekvienas varžybų dalyvis turi turėti ne mažiau kaip du graibštus.\n12. Registruojamos tik gyvos žuvys, pagautos varžybų tvenkinyje varžybų metu.\n13. Įskaitinės žuvys yra visų rūšių karpiai ir amūrai.\n14. Sugautos įskaitinės žuvys sveriamos tik teisėjo svėrimo įrankiais ir svarstyklėmis. Žuvis sveriama kiek galima dažniau, bet ne rečiau kaip 4 kartus per parą.\n15. Jeigu žuvis užkibo iki varžybų pabaigos ir varžybų dalyvis mano, kad žuvis galimai bus ištraukta jau po varžybų finišo, ją leidžiama ištraukti, ir ji bus registruojama, tačiau nedelsiant po kibimo turi būti pranešta teisėjui arba kaimynams, kad žuvis traukiama.\n16. Kiekvieno sektoriaus šoninės ribos yra pažymėtos. Kai kurie sektoriai gali būti apriboti ir metimo nuotoliu. Apie sektorių apribojimus varžybų organizatoriai informuos iš anksto. Ginčus tarp dalyvių dėl žūklės sektorių ribų sprendžia patys varžybų dalyviai, neišsprendus ginčo – jis sprendžiamas neapskundžiamu (galutiniu) varžybų teisėjo sprendimu.\n17. Dalyviui pasitraukus iš sektoriaus toliau nei 50 metrų žūklės įrankiai turi būti ištraukti iš vandens.\n18. Į ne savo sektorių patekti kitiems varžybų dalyviams galima tik gavus sektoriaus dalyvio sutikimą. Sutikimas nebūtinas varžybų organizatoriui, teisėjui, telkinio savininkui arba jo atstovui, žurnalistams.\n19. Varžybos dalyviai privalo: gerbti kitus varžybų dalyvius; esant nenumatytai situacijai (trauma, nelaimingas atsitikimas ir t.t..) padėti kitiems; sektoriuje palaikyti švarą; kilus šiose taisyklėse nenumatytiems klausimams ar situacijoms nedelsiant susisiekti su teisėju ir jį informuoti.\n20. Dalyviui nusižengus taisyklėms pirmą kartą, teisėjai gali stabdyti dalyvavimą varžybose 4 val., dalyviui prasižengus antrą kartą, skiriama 8 val. diskvalifikacija. Trečią kartą nusižengęs taisyklėms dalyvis diskvalifikuojamas. Už grubius taisyklių pažeidimus ar besaikį alkoholio vartojimą, dalyvis gali būti šalinamas iš varžybų nedelsiant teisėjų nuožiūra.'),(12,'Pikts Karpis, Punia 2018','2018-05-04 00:00:00',2,'Pikts Karpis','info@piktsKarpis.lt','Pykaičiai','total',1,'finished',7,4,'https://www.facebook.com/events/1181032402028380/?active_tab=about','1. Varžomasi komandoje, komandą sudaro du kapininkai, komandą gali lankyti svečiai, tačiau jie negali padėti varžybų dalyviams.\n2. Tyrinėti sektorių markeriu, jaukinti žuvį ir masalus mesti į vandenį galima tik nuo varžybų starto pradžios.\n3. Žvejoti galima 4-mis įrankiais turinčiais po 1 kablį. Paruoštų įrankių skaičius neribojamas.\n4. Markeris naudojamas tik dugno tyrinėjimui ir gylio nustatymui, baigus dugno tyrinėjimą markeris turi būti ištrauktas iš vandens. Markerį naudoti kaip žymeklį draudžiama.\n5. Jaukinti ir masalus mesti galima tik iš savo sektoriaus zonos (swim’o) visais būdais, išskyrus valtis ir specialius laivelius.\n6. Nuo 19:00 valandos iki 7:00 valandos jaukinti žuvis naudojant triukšmingus jaukinimo įrankius, tokius kaip spomb‘as, raketas, „krabus“ draudžiama.\n7. Masalas tvirtinamas prie kabliuko naudojant „plauko sistemą“. Draudžiama naudoti gyvus jaukus ir masalus (musės lervos, sliekai, uodo trūklio lervos ir pan.).\n8. Žuvies ištraukimas ne savo sektoriuje yra leidžiamas kaimyniniam sektoriui sutikus. Bristi į vandenį galima tik iki juosmens.\n9. Kol žuvis bus pasverta ir užregistruota, ją reikia laikyti specialiame maiše, vandenyje. Viename maiše gali būti ne daugiau kaip viena žuvis. Privaloma turėti ne mažiau kaip 7 specialius maišus žuviai laikyti.\n10. Kiekviena komanda privalo turėti specialų čiužinį žuviai guldyti ant žemės (matą).\n11. Kiekviena varžybų komanda turi turėti ne mažiau kaip du graibštus.\n12. Registruojamos tik gyvos žuvys, pagautos varžybų tvenkinyje varžybų metu.\n13. Įskaitinės žuvys yra visų rūšių karpiai ir amūrai.\n14. Sugautos įskaitinės žuvys sveriamos tik teisėjo svėrimo įrankiais ir svarstyklėmis. Žuvis sveriama kiek galima dažniau, bet ne rečiau kaip 3 kartus per parą.\n15. Jeigu žuvis užkibo iki varžybų pabaigos ir varžybų dalyvis mano, kad žuvis galimai bus ištraukta jau po varžybų finišo, ją leidžiama ištraukti, ir ji bus registruojama, tačiau nedelsiant po kibimo turi būti pranešta teisėjui arba kaimynams, kad žuvis traukiama.\n16. Kiekvieno sektoriaus šoninės ribos yra pažymėtos. Kai kurie sektoriai gali būti apriboti ir metimo nuotoliu. Apie sektorių apribojimus varžybų organizatoriai informuos iš anksto. Ginčus tarp dalyvių dėl žūklės sektorių ribų sprendžia patys varžybų dalyviai, neišsprendus ginčo – jis sprendžiamas neapskundžiamu (galutiniu) varžybų teisėjo sprendimu.\n17. Komandos abiems nariams pasitraukus iš sektoriaus toliau nei 50 metrų žūklės įrankiai turi būti ištraukti iš vandens.\n18. Į ne savo sektorių patekti kitiems varžybų dalyviams galima tik gavus sektoriaus dalyvio sutikimą. Sutikimas nebūtinas varžybų organizatoriui, teisėjui, telkinio savininkui arba jo atstovui, žurnalistams.\n19. Varžybos dalyviai privalo: gerbti kitus varžybų dalyvius; esant nenumatytai situacijai (trauma, nelaimingas atsitikimas ir t.t..) padėti kitiems; sektoriuje palaikyti švarą; kilus šiose taisyklėse nenumatytiems klausimams ar situacijoms nedelsiant susisiekti su teisėju ir jį informuoti.\n20. Komandai nusižengus taisyklėms pirmą kartą, teisėjai gali stabdyti dalyvavimą varžybose 4 val., Komandai prasižengus antrą kartą, skiriama 8 val. diskvalifikacija. Trečią kartą nusižengęs taisyklėms komanda diskvalifikuojama. Už grubius taisyklių pažeidimus ar besaikį alkoholio vartojimą, dalyvis gali būti šalinamas iš varžybų nedelsiant teisėjų nuožiūra'),(13,'\"Didelėsžuvys.lt-2015\" Finalas','2015-08-14 00:00:00',3,'Didelėsžuvys.lt','info@didelėszuvys.lt','Didelėsžuvys.lt','total',1,'finished',7,3,'','\n\n    Pagal atvykusių komandų eilės tvarką komandos traukia eilės numerius pagal kurios komandos trauks sektoriaus numerį. Po komandų sektorių traukimo, pretenzijos dėl sektorių nepriimamos.\n\n    Pasiruošimo metu komandos gali tyrinėti sektorių markeriu. Markeris naudojamas tik dugno tyrinėjimui ir gylio nustatymui, baigus dugno tyrinėjimą markeris turi būti ištrauktas iš vandens. Markerį naudoti kaip žymeklį draudžiama.\n\n    Jaukinti žuvį ir masalus mesti į vandenį galima tik nuo varžybų pradžios.\n\n    Komanda gali žvejoti 4 įrankiais turinčiais po 1 kablį. Paruoštų įrankių skaičius neribojamas.\n\n    Meškerės turi būti žūklės sektoriuje, paruoštoje zonoje. Jaukinti galima tik iš savo sektoriaus zonos visais būdais, išskyrus valtis ir specialius laivelius. Galima bristi į vandenį ne giliau kaip iki juosmens.\n\n    Nuo 22 valandos vakaro iki 5 valandos ryto jaukinti žuvis naudojant triukšmingus jaukinimo įrankius, tokius kaip spomb‘as, raketas, „krabus“ draudžiama.\n\n    Masalų užmetimui galioja šių taisyklių penkto punkto reikalavimai.\n\n    Ne komandos dalyviams dalyvauti žvejybos procese (imti žūklės įrankius, ruošti pašarus ir pan.) draudžiama.\n\n    Masalas tvirtinamas prie kabliuko naudojant „plauko sistemą“ (negalima verti tiesiai ant kabliuko).\n\n    Draudžiama naudoti gyvus ir cielus gyvulinės kilmės jaukus ir masalus (musės lervos, sliekai, uodo trūklio lervos ir pan.).\n\n    Žuvies ištraukimas ne savo sektoriuje yra leidžiamas kaimyninio sektoriaus komandai sutikus.\n\n    Kol žuvis bus pasverta ir užregistruota, ją reikia laikyti specialiame maiše, vandenyje. Viename maiše gali būti ne daugiau kaip viena žuvis. (savininkui sutikus galima žuvį laikyti graibšte kol ji bus pasverta). Komanda privalo turėti ne mažiau kaip 6 specialius maišus žuviai laikyti.\n\n    Žuvys sveriamos tris kartus per parą. Esant galimybei, žuvys gali būti sveriamos ir dažniau.\n\n    Kiekviena komanda privalo turėti specialų čiužinį žuviai guldyti ant žemės (matą).\n\n    Registruojamos tik gyvos žuvys, pagautos „Didelėsžuvys.lt“ tvenkinyje varžybų metu.\n\n    Įskaitinės žuvys yra nuo 5 kg visų rūšių karpiai, amūrai, eršketai, šamai.\n\n    Jei ištraukus žuvį kabliukas nėra įkibęs galvos srityje, žuvis neužskaitoma.\n\n    Sugautos įskaitinės žuvys sveriamos tik teisėjo svėrimo įrankiais ir svarstyklėmis.\n\n    Jeigu žuvis užkibo iki varžybų pabaigos ir komanda mano, kad žuvis galimai bus ištraukta jau po varžybų finišo, ją leidžiama ištraukti ir ji bus registruojama, tačiau nedelsiant po kibimo turi būti pranešta teisėjui arba kaimyninėm komandom, kad žuvis traukiama. Nesant tokio pranešimo teisėjui, žuvis bus registruojama tik tuo atveju, jei ji bus ištraukta ir apie tai paliudys kaimyninės komandos, kad žuvis užkibo iki varžybų pabaigos.\n\n    Kiekvieno sektoriaus šoninės ribos yra pažymėtos kuoliukais. Kai kurie sektoriai gali būti apriboti ir metimo nuotoliu. Apie sektorių apribojimus varžybų organizatoriai informuos iš anksto. Ginčus tarp komandų dėl žūklės sektorių ribų sprendžia patys varžybų dalyviai, neišsprendus ginčo – jis sprendžiamas neapskundžiamu (galutiniu) varžybų teisėjo sprendimu.\n\n    Komandos nariams pasitraukus iš sektoriaus toliau nei 50 metrų žūklės įrankiai turi būti ištraukti iš vandens (išskyrus markerį).\n\n    Į sektorių patekti kitiems varžybų dalyviams galima tik gavus komandos narių sutikimą. Sutikimas nebūtinas varžybų organizatoriui, teisėjui, telkinio savininkui arba jo atstovui, žurnalistams.\n\n    Varžybose dalyvaujanti komanda privalo: gerbti kitus varžybų dalyvius; esant nenumatytai situacijai (trauma, nelaimingas atsitikimas ir t.t..) padėti kitiems; sektoriuje palaikyti švarą; kilus šiose taisyklėse nenumatytiems klausimams ar situacijoms nedelsiant susisiekti su teisėju ir jį informuoti.\n\n    Nusižengusiai taisyklėms komandai pirmą kartą teisėjai gali skirti nuobaudą -5kg iš komandos sugautų žuvų svorio. Antrą kartą prasižengusiai kamandai skiriama nuobauda -10kg iš komandos sugautų žuvų svorio. Trečią kartą nusižengusi taisyklėms komanda diskvalifikuojama. Už grubius taisyklių pažeidimus ar besaikį alkoholio vartojimą, komanda gali būti šalinama iš varžybų nedelsiant teisėjų nuožiūra.\n\n \n\nKomandos varžybų starto mokestis 200 € sumokamas ne vėliau kaip likus 60 dienų iki varžybų pradžios.\n\nSumokėti galima banko pavedimu\n\nSąskaita - LT077290000139702013\n\nGavėjas - Kęstutis Arbačiauskas\n\nMokėjimo paskirtis - Varžybų starto mokestis \"komandos pavadinimas\"\n\nPirmąją vietą užėmusi komanda ateinančių metų varžybose registruojama be startinio mokesčio.'),(14,'\"Didelėsžuvys.lt-2015\" A pogrupis','2015-07-31 00:00:00',3,'Didelėsžuvys.lt','info@didelėszuvys.lt','Didelėsžuvys.lt','total',1,'finished',7,3,'','\n\n    Pagal atvykusių komandų eilės tvarką komandos traukia eilės numerius pagal kurios komandos trauks sektoriaus numerį. Po komandų sektorių traukimo, pretenzijos dėl sektorių nepriimamos.\n\n    Pasiruošimo metu komandos gali tyrinėti sektorių markeriu. Markeris naudojamas tik dugno tyrinėjimui ir gylio nustatymui, baigus dugno tyrinėjimą markeris turi būti ištrauktas iš vandens. Markerį naudoti kaip žymeklį draudžiama.\n\n    Jaukinti žuvį ir masalus mesti į vandenį galima tik nuo varžybų pradžios.\n\n    Komanda gali žvejoti 4 įrankiais turinčiais po 1 kablį. Paruoštų įrankių skaičius neribojamas.\n\n    Meškerės turi būti žūklės sektoriuje, paruoštoje zonoje. Jaukinti galima tik iš savo sektoriaus zonos visais būdais, išskyrus valtis ir specialius laivelius. Galima bristi į vandenį ne giliau kaip iki juosmens.\n\n    Nuo 22 valandos vakaro iki 5 valandos ryto jaukinti žuvis naudojant triukšmingus jaukinimo įrankius, tokius kaip spomb‘as, raketas, „krabus“ draudžiama.\n\n    Masalų užmetimui galioja šių taisyklių penkto punkto reikalavimai.\n\n    Ne komandos dalyviams dalyvauti žvejybos procese (imti žūklės įrankius, ruošti pašarus ir pan.) draudžiama.\n\n    Masalas tvirtinamas prie kabliuko naudojant „plauko sistemą“ (negalima verti tiesiai ant kabliuko).\n\n    Draudžiama naudoti gyvus ir cielus gyvulinės kilmės jaukus ir masalus (musės lervos, sliekai, uodo trūklio lervos ir pan.).\n\n    Žuvies ištraukimas ne savo sektoriuje yra leidžiamas kaimyninio sektoriaus komandai sutikus.\n\n    Kol žuvis bus pasverta ir užregistruota, ją